import { styled } from "styled-component";
import React from "react"

const SearchBarWrapper = styled.div`
border:1px solid black;
border-radius: 20px;
padding:10px;
display:flex;
position:realtive;

`;

const IconImage = styled.img`
height:20px;
padding:20px;
`;
const SearchBar = ()=>{

    return(

        <SearchBarWrapper>
            <h1> Search Bar</h1>
        </SearchBarWrapper>
    )
}

export default SearchBar;
